import "./App.css";
import Header from "./Header/Header";
import Button from "./Button/Button";
import { Router, Route } from "react-router-dom";
import Home from "./Home";

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/about">О нас</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/about">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
